import React from 'react';

// styles.
import '../styles/customButton.scss';

const CustomButton = ({ children, isGoogleSignIn, inverted, ...otherProps}) => (
    
    <button className={`${isGoogleSignIn ? 'google-sign-in' : ''}
        ${inverted ? 'inverted' : ''}
        custom-button`} 
        {...otherProps}
    >
        {children}
    </button>
);

export default CustomButton;
